//Navbar.js
import React from 'react';
import './Navbar.scss';

const Navbar = ({ isAuthenticated }) => {
  // Define the base URL for your Flask backend
  const backendUrl = 'http://localhost:5000';

  return (
    <nav className="navbar">
      <div className="navbar-title">Project Management App</div>
      <div className="navbar-links">
        {!isAuthenticated ? (
          <>
            <a href={`${backendUrl}/login`} className="nav-link">Login</a>
            <a href={`${backendUrl}/register`} className="nav-link">Register</a>
          </>
        ) : (
          // Implement logout functionality, potentially making a POST request to backend to terminate the session
          <button onClick={() => window.location.href = `${backendUrl}/logout`} className="nav-link">Logout</button>
        )}
      </div>
    </nav>
  );
};

export default Navbar;
